import React from "react";
import ExpenseItem from "./ExpenseItem";

function Expenses(props) {
  return (
    <div>
      props.title.map((index, val) =>
      <ExpenseItem title={props.expense[index].title} />)
    </div>
  );
}

export default Expenses;
